import React from 'react';
import Button from 'react-bootstrap/Button';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import { Nav } from 'react-bootstrap';
import {NavDropdown} from 'react-bootstrap';



const renderTooltip = props => (
  <div
    {...props}
    style={{
      
      padding: '2px 10px',
      color: 'rgba(0,0,0,.5)',
      borderRadius: 3,
      ...props.style,
    }}
  >
        <NavDropdown.Item href="#action/3.1">Sandalwood</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Vanilla</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Amber</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Patchouli</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Oakmoss</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Musk</NavDropdown.Item>
    
  
  </div>  
);

const Notes = () => (
  <OverlayTrigger
    placement="bottom-start"
    delay={{ show: 250, hide: 4000 }}
    overlay={renderTooltip}
  >
    
  </OverlayTrigger>
);

export default Notes;
